import React from 'react'

import { Page, Item, ItemText, Scroll, Listagem } from './styles'
import lista from '../../assets/listaScrol'

export default function Lista() {
  return (
    <Page>
      <Scroll>
        {lista.map((item, index) => {
          return (
            <Item key={index} activeOpacity={0.4}>
              <ItemText>{item.task} </ItemText>
            </Item>
          )
        })}
      </Scroll>
      <Listagem 
        data={lista}
        renderItem={() => {}}
      />
    </Page>
  )
}
